import React from 'react'

interface Props{
    title: string;
    description: string;
    image: string;
    price: number;
    content: string;
    //enum
    category:Category
}
enum Category{
  JS = "JavaScript"
}
function Destruturing({ title, description, image, price, content}:Props) {
  return (
    <div>
        <h1>{title}</h1>
        <p>{description}</p>
        <img src={image} alt={title} />
        <p>{price}</p>
        <p>{content}</p>
        
    </div>
  )
}

export default Destruturing
